INSERT INTO `advisory` (`id`, `team_id`, `text`, `post_timestamp`, `score`) VALUES
(4, 2, 'Стандартный пароль на логин admin в сервисе на PHP Pa$$w0rD\r\nСменить пароль можно ваполнив sql запрос  \r\n update users_1 set password = ''нев пароль'' where login = ''admin'';', '0000-00-00 00:00:00', 24),
(5, 3, '1)При регистрации с пустым логином паролем , Django  выдаает ошибку в которой , очень много всего пути,  логины \r\n2)PHP включены все ошибки , и  по рестарту устонавливается одинаковый пароль и логин администратора \r\n', '0000-00-00 00:00:00', 18),
(6, 1, '1. Php. \r\nОписание: Уязвимость в функции Restart, которая перезапускает сам сервер.\r\nИспользование: перезапуск сервера любым пользователем (кнопка доступна всем).\r\nИсправление: изменение функции Restart (например, использование только админом)\r\n\r\n2. Php.\r\nОписание: Пользователи могут открывать сообщения любых других пользователей.\r\nИспользование: Создание нового пользователя позволяет просмотреть сообщения любых других пользователей.\r\nИсправление: Разрешить смотреть только собственные сообщения.\r\n', '0000-00-00 00:00:00', 6),
(8, 1, 'В функции restart можно найти пароль admin-a.=> Любой юзер может зайти под ним и он видит сообщ. каджого пользователя и видит флаги. Нужно изменить пароль admin-а.', '0000-00-00 00:00:00', 24),
(9, 2, 'Чтобы после каждой регистрации на php сервисе нельзя было забрать два флага, меняем четвертую строку в config.php на $commishion = 5000;', '0000-00-00 00:00:00', 0);
